import { createSelector } from 'reselect';
import get from 'lodash/get';

const _getUserSettings = state => state.userSettings;
export const getUserSettings = createSelector(_getUserSettings, userSettings => userSettings);
export const useRealImages = createSelector(getUserSettings, userSettings => get(userSettings, 'realImages', false));

export const getCollection = createSelector(getUserSettings, userSettings => get(userSettings, 'collection', false));
export const getViewType = createSelector(getCollection, collection => get(collection, 'viewType', false));
export const getCardViewType = createSelector(getViewType, viewType => get(viewType, 'cardView', false));
export const getTableViewType = createSelector(getViewType, viewType => get(viewType, 'tableView', false));

export const getSortDirection = createSelector(getUserSettings, userSettings => get(userSettings, 'sort', false));

export const getDemoMode = createSelector
